import React from 'react'
import { isButtonElement } from 'react-router-dom'
import NavItem from './NavItem'
import { v4 as uuidv4 } from 'uuid';

const navList = [
  {text: "Art", url: "/"},
  {text: "About", url: "/About"},
  {text: "More", url: "/More"}
]



const Navbar = () => {
  return (
    // <nav className='container mx-auto min-w-full sm:px-6 md:px-10 sm:py-3 md:py-4 bg-white box shadow-md hover:md:py-6 hover:text-lg border-solid border-b-[1px] border-stone-400 transition ease-in-out delay-150 hover:transition-all'>
    // <nav className='flex flex-row bg-white bg-opacity-50 justify-around shadow-md hover:md:py-6 border-stone-400 ease-in-out transition-all duration-500 hover:flex'>
    //   <div className='text-center'>
    //     <h1 className='mx-auto'>Project Mayce</h1>
    //   </div>
    //   <div className='basis-4/12'></div>
    //   <ul className='flex flex-row ease-in-out transition-all basis-3/12 hover:basis-4/12 last:border-r-0'>
    //     {navList.map((item, i, isLast) => {
    //       return <NavItem
    //               key={uuidv4()}
    //               text={item.text}
    //               url={item.url} 
    //               isLast={i === navList.length-1 ? true : false}/>
    //     })}
    //   </ul>
    // </nav>
    <>
    <nav className='flex flex-row bg-white bg-opacity-50 justify-around shadow-md border-stone-400 ease-in-out transition-all duration-500'>
      <div className='text-center'>
        <h1 className='mx-auto'>Project Mayce</h1>
      </div>
      <div className='basis-4/12'></div>
      <ul className='flex flex-row ease-in-out transition-all basis-3/12 hover:basis-4/12 last:border-r-0'>
        {navList.map((item, i, isLast) => {
          return <NavItem
                  key={uuidv4()}
                  text={item.text}
                  url={item.url} 
                  isLast={i === navList.length-1 ? true : false}/>
        })}
      </ul>
    </nav>

    <nav className='grid grid-cols-12 bg-white bg-opacity-50 justify-around shadow-md border-stone-400 ease-in-out transition-all duration-500'>
      <div className='col-span-3 text-center'>
        <h1 className='mx-auto'>Project Mayce</h1>
      </div>
      <div className='col-span-9 col-start-1 my-auto flex flex-row-reverse'>
        <div className='basis-2/8'></div>
        <ul className='ease-in-out transition-all basis-5/8 hover:basis-6/8 last:border-r-0'>
          {navList.map((item, i, isLast) => {
            return <NavItem
                    key={uuidv4()}
                    text={item.text}
                    url={item.url} 
                    isLast={i === navList.length-1 ? true : false}/>
          })}
        </ul>
      </div>
    </nav>
    </>

  )
}

export default Navbar
